import React, { useState } from "react";

function UserForm() {
  const [lastName, setLastName] = useState("");
  const [firstName, setFirstName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");


  const formSubmit = (e) => {
    e.preventDefault();
    const data = {
      lastName: lastName,
      firstName: firstName,
      email: email,
      password: password,
      confirmPassword: confirmPassword,
    };
    console.log("DATA: ", data);
  };
  return (
    <div>
      <form onSubmit={formSubmit}>
        <div>
          Last Name:{" "}
          <input type="text" value={lastName} onChange={(e)=>lastNameChange} />
        </div>
        <div>
          First Name:{" "}
          <input type="text" value={firstName} onChange={firstNameChange} />
        </div>
        <div>
          Email: <input type="text" value={email} onChange={emailChange} />
        </div>
        <div>
          Password:{" "}
          <input type="text" value={password} onChange={passwordChange} />
        </div>
        <div>
          Confirm Password:{" "}
          <input
            type="text"
            value={confirmPassword}
            onChange={confirmPasswordChange}
          />
        </div>
        <div>
          <button>Submit</button>
        </div>
      </form>
    </div>
  );
}

export default UserForm;
